import React from "react";
import { useNavigate } from "react-router-dom";
import "../styles/Login.css";

export default function Login() {
  const navigate = useNavigate();

  return (
    <div className="login-container">
      {/* Left Side with Blur and Content */}
      <div className="login-left">
        <h1>Welcome to Freelancer Manager</h1>
        <p>
          Are you free now? Pick a project, work, and earn on your own!
        </p>
        <button onClick={() => navigate("/dashboard")}>
          Get Started
        </button>
      </div>

      {/* Right Side with Image */}
      <div className="login-right">
        <img
          src="https://images.unsplash.com/photo-1522206024047-9c925421675b?auto=format&fit=crop&w=1350&q=80"
          alt="Freelancing"
        />
      </div>
    </div>
  );
}
